import React from 'react';

function Community({ user }) {
  // This can be expanded with more logic for tribes and challenges
  return (
    <div className="tab-content community-tab">
      <h2>üåç Community Hub</h2>
      <p>Connect with others, share your journey, and find support.</p>
      <div className="feature-coming-soon">
          <h3>Mood Tribes, Challenges, and more are coming soon!</h3>
          <p>We're building a safe and supportive space for you to connect.</p>
      </div>
    </div>
  );
}

export default Community;
